import axios from "axios";
import { useEffect, useState } from "react";

export default function filmSearch(query, pageNumber) {
  const url =
    "https://api.themoviedb.org/3/search/multi?api_key=42c75a6b80c35f26dc7f205b88001ee4&language=en-US&query=batman&page=1";

  useEffect(() => {
    axios.get({ url: url, params: { q: query, page: pageNumber } });
  }, [query, pageNumber]).then((res) => console.log(res.data));
  return <div>FilmSearch</div>;
}
